description:
{
    "Giới thiệu": "Chung cư 30T Nam Trung Yên do Công ty đầu tư và phát triển nhà Hà Nội – Handico làm chủ đầu tư với quy mô 2 tòa 30T1 và 30T2 cao 30 tầng. Khu đất triển khai dự án có diện tích 5,3ha, thuộc quỹ đất tái định cư trong Khu đô thị Nam Trung Yên, trung tâm quận Cầu Giấy, Hà Nội.  Dự án đã hoàn thiện và bàn giao với 3 tầng thương mại khối đế, tầng 4-30 là khu căn hộ để ở.",
    "Vị Trí": {
        "paragraphs": [
            "Chung cư 30T Nam Trung Yên toạ lạc tại góc đường Nguyễn Chánh giao với đường Mạc Thái Tổ, đối diện cơ quan Kiểm toán Nhà nước. Đây là khu vực có giao thông đồng bộ, kết nối thuận lợi của quận Cầu Giấy. Trong vòng bán kính 2km từ dự án, cư dân có thể dễ dàng di chuyển đến các cơ quan hành chính, khu văn phòng, trường đại học lớn và các dịch vụ, tiện ích đáp ứng nhu cầu sống hiện đại thông qua các tuyến đường như Dương Đình Nghệ, Trần Duy Hưng, Nguyễn Chánh, đường vành đai 3 Phạm Hùng hay đường Mạc Thái Tổ. :",
            "3 phút di chuyển đến Viện huyết học – Truyền máu Trung ương, Công viên Cầu Giấy, siêu thị Big C Thăng Long5 phút đến Trung Tâm Hội Nghị Quốc Gia, Bảo tàng Hà Nội, Khách sạn JW Marriott, Bến xe Mỹ Đình, Bệnh Viện 19 – 87 phút đến Sân vận động Quốc gia Mỹ Đình"
        ],
        "items": []
    },
    "Giá Bán": {
        "paragraphs": [
            "Về giá bán, căn hộ Chung cư 30T Nam Trung Yên có mức giá dao động từ 45-47 triệu đồng/m2, tuỳ thuộc vị trí và loại căn 1-2-3 ngủ.",
            "Xem tin đăng và giá bán căn hộ Chung cư 30T Nam Trung Yên cập nhật mới nhất!Xem tin đăng và giá cho thuê căn hộ Chung cư 30T Nam Trung Yên cập nhật mới nhất!"
        ],
        "items": []
    },
    "Tiện Ích": {
        "paragraphs": [
            "Chung cư 30T Nam Trung Yên có 3 tầng hầm để xe, tầng 1 là khu dịch vụ công cộng, sảnh và phụ trợ. Bên cạnh đó, cư dân khi sinh sống tại đây cũng được tận hưởng những tiện ích hiện đại ngay nội khu dự án như:"
        ],
        "items": [
            "Khu thương mại dịch vụ",
            "Phòng sinh hoạt cộng đồng",
            "Khuôn viên vui chơi, thư giãn",
            "Công viên",
            "Siêu thị",
            "Hệ thống an ninh 24/24",
            "Khu vui chơi trẻ em",
            "Đường dạo bộ",
            "Hầm gửi xe",
            "Khu thương mại dịch vụ tại các tầng khối đế"
        ]
    },
    "Thiết Kế - Mặt Bằng": {
        "paragraphs": [
            "Chung cư 30T1 30T2 Nam Trung Yên bố trí 14 căn hộ một mặt sàn với 6 thang máy, 3 cầu thang bộ thuận tiện cho cứu nạn cứu hộ và di chuyển. Các căn hộ có thiết kế từ 1-3 phòng ngủ với diện tích đa dạng, phù hợp nhu cầu của người trẻ độc thân đến gia đình đa thế hệ:"
        ],
        "items": [
            "Căn 1 PN 1 WC: 43m2 - 46m2",
            "Căn 2 PN 1WC: 50- 55 - 58m2",
            "Căn 3 PN 2WC: 75m2"
        ]
    },
    "Tiến Độ": {
        "paragraphs": [
            "Dự án Chung cư 30T Nam Trung Yên đã hoàn thiện và bàn giao với nội thất cơ bản gồm:"
        ],
        "items": [
            "Tường sơn hoàn thiện",
            "Hệ thống cửa chính chống cháy, cửa thông phòng bằng gỗ, cửa kính, cửa lùa phòng khách và phòng ngủ",
            "Lan can logia tiêu chuẩn",
            "Sàn gạch tiêu chuẩn cho phòng khách, phòng ngủ, ban công và nhà tắm.",
            "Hoàn thiện toàn bộ hệ thống điện, hệ thống chiếu sáng, công tắc điều khiển,",
            "Trần nhà, tường được sơn và đi hệ thống điện sẵn.",
            "Thiết bị khu vệ sinh hoàn thiện với lát gạch, vòi sen, vòi nước, lavabo, bồn cầu,…"
        ]
    }
}

{
    "Giới thiệu": "Lumi Prestige là phân khu thuộc dự án Lumi Hanoi được đầu tư bởi CapitaLand Development Vietnam. Dự án gồm 2 tháp căn hộ Prestige 1 & 2 cao 30 tầng, quy mô 878 căn hộ chung cư thiết kế từ 1-4 phòng ngủ và Penthouse. Thuộc giai đoạn 2 của dự án Lumi Hanoi, Lumi Prestige hứa hẹn mang đến một không gian sống tiện nghi, hiện đại cho cư dân khu vực phía Tây Hà Nội.",
    "Vị Trí": {
        "paragraphs": [
            "Tọa lạc trên mặt đường đại lộ Thăng Long, phường Tây Mỗ, quận Nam Từ Liêm, Hà Nội, dự án Lumi Prestige kết nối trực tiếp với các tuyến đường quan trọng như đường vành đai 3, 5, đường Lê Trọng Tấn, xung quanh là hệ thống cơ sở hạ tầng được quy hoạch bài bản. Cách trung tâm thành phố khoảng 25 phút chạy xe, khu vực này khá thuận tiện cho việc di chuyển tới các tiện ích kế cận, không chỉ đảm bảo chất lượng sống của cư dân mà còn hứa hẹn tiềm năng tăng giá cho bất động sản, nhất là khi khu Tây Hà Nội được hưởng lợi từ mạng lưới giao thông đang ngày một nâng cấp, hoàn thiện với hệ thống metro tuyến 5-6-7 sẽ “thành hình” trong tương lai.",
            "Với những ưu điểm về vị trí, hạ tầng, cư dân dự án sẽ không cần quá lo ngại khi dễ dàng kết nối đến khu vực nội đô và vùng lân cận:"
        ],
        "items": [
            "Đi theo Đại Lộ Thăng Long để vào nội đô hoặc các tỉnh phía Tây Hà Nội",
            "Đi theo trục đường 72 để đến các tỉnh phía Tây Bắc Hà Nội.",
            "Di chuyển qua cầu vượt Tây Mỗ để kết nối với đường Lê Trọng Tấn, đường Hàm Nghi,…sẽ tiết kiệm thời gian di chuyển, tránh tắc nghẽn giao thông vào giờ cao điểm."
        ]
    },
    "Giá Bán": {
        "paragraphs": [
            "Xem tin đăng và giá bán căn hộ Lumi Prestige by CapitaLand: Giá bán RUMOR căn hộ Lumi Prestige: từ 69 triệu đồng/m2."
        ],
        "items": []
    },
    "Tiện Ích": {
        "paragraphs": [
            "Lumi Prestige sở hữu 88 tiện ích với 52 tiện ích trong nhà và 36 tiện ích ngoài trời, tạo trải nghiệm sống thư thái cân bằng với nhịp sống hiện đại như khu tiệc BBQ sức chứa lên tới 100 người, hồ sinh thái, đường dạo nổi, bể bơi cực quang 50m, phòng gym ~330m2, bể bơi spa & jacuzzi 4 mùa, sân tennis trong nhà, Khu vui chơi trẻ em, trạm sạc xe điện EV Charging…"
        ],
        "items": []
    },
    "": {
        "paragraphs": [],
        "items": []
    },
    "Mặt Bằng": {
        "paragraphs": [
            "Là giai đoạn 2 của Lumi Hanoi, phân khu Lumi Prestige gồm 2 tòa căn hộ Prestige 1 & 2 cao 30 tầng. Không chỉ có kiến trúc ấn tượng lấy cảm hứng từ \"màn trình diễn ánh sáng\" cực quang trên bầu trời đêm, Lumi Prestige còn sở hữu quy hoạch được tối ưu hóa với không gian tiện ích và cảnh quan xanh thoáng đãng, mang đến môi trường sống lý tưởng, gần gũi với thiên nhiên.",
            "Các căn hộ Lumi Prestige có thiết kế từ 1 đến 4 phòng ngủ, bàn giao theo tiêu chuẩn cao cấp với khóa cửa thông minh 5 trong 1, lò nướng, đèn trần, tủ quần áo, ban công kính và cửa sổ full kính chạm sạn tại phòng ngủ chính."
        ],
        "items": [
            "Căn hộ 1 PN: 42.2m2",
            "Căn hộ 2PN: 53.8 - 85.8m2",
            "Căn hộ 3PN: 85.8 - 138.9m2",
            "Căn hộ 4PN: 125.8 - 146.9m2",
            "Penthouse: 338 - 412m2"
        ]
    },
    "Tiến Độ": {
        "paragraphs": [
            "Dự án Lumi Prestige dự kiến sẽ ra mắt vào 7/7/2024."
        ],
        "items": []
    }
}

{
    "Giới thiệu": "The Beverly là tên phân khu căn hộ nằm trong dự án khu đô thị Vinhomes Ocean Park Gia Lâm, Hà Nội. Được ra mắt năm 2024, phân khu The Beverly sở hữu lợi thế vị trí trung tâm The Metropolitan và quy hoạch đẳng cấp với 4 tòa căn hộ cao cấp được thiết kế theo tiêu chuẩn Vinhomes. Đây sẽ là sự bổ sung nguồn cung căn hộ mới tại phía Đông hà Nội.",
    "Vị Trí": {
        "paragraphs": [
            "Khu căn hộ The Beverly Ocean Park là một phần của phân khu Metropolitan, nằm tiếp giáp với trục đường Lê Thánh Tông. Vị trí này cũng là một trong những trục giao thông chính của huyện Gia Lâm, dễ dàng di chuyển tới cao tốc Hà Nội – Hải Phòng.",
            "Ngoài ra, trong tương lai, khi tuyến Metro số 8 đi vào hoạt động sẽ càng thuận lợi hơn cho cư dân khi cần di chuyển vào trung tâm Hà Nội hay đi các khu vực lân cận."
        ],
        "items": []
    },
    "Giá Bán": {
        "paragraphs": [
            "Quý 2/2024, dự án chung cư The Beverly - Vinhomes Ocean Park đang nhận booking để mở bán đợt đầu tiên. Giỏ hàng mở bán đợt đầu sẽ gồm các căn hộ thuộc 2 tòa BE2 và BE3.",
            "Xem tin đăng và giá bán căn hộ The Beverly - Vinhomes Ocean Park cập nhật mới nhất trên Batdongsan.com.vn!"
        ],
        "items": []
    },
    "Tiện Ích": {
        "paragraphs": [
            "Ngoài không gian cảnh quan kiến trúc và những tiện ích nội khu mang đậm chất Mỹ thời thượng, phân khu The Beverly còn được thừa hưởng trọn vẹn hệ sinh thái tiện ích sẵn có cực kỳ đa dạng của khu đô thị Vinhomes Ocean Park như:"
        ],
        "items": [
            "Trung tâm thương mại Vincom",
            "Trường liên cấp Vinschool",
            "Trường quốc tế Brighton College, Deway",
            "Bộ đôi biển hồ",
            "Chuỗi các công viên, tiện ích (sân thể thao, gym, sân chơi trẻ em,…)",
            "Hệ thống bể bơi tiêu chuẩn Olympic"
        ]
    },
    "Thiết Kế": {
        "paragraphs": [
            "Phân khu The Beverly Ocean Park được quy hoạch gồm 4 tòa căn hộ: BE1, BE2, BE3 và BE4.",
            "Lấy cảm hứng từ những kiến trúc xây dựng tại Beverly Hills (Mỹ), dự án căn hộ The Beverly Vinhomes Ocean Park sở hữu thiết kế mạnh mẽ, phóng khoáng với những đường nét vuông vức, góc cạnh. Thiết kế phóng khoáng với nhiều cửa sổ kính và ban công rộng giúp cho các phòng đều thoáng và tràn ngập ánh sáng tự nhiên.Bên cạnh đó, kiến trúc mặt ngoài các tòa căn hộ The Beverly  được sử dụng vật liệu cao cấp như kính, gỗ, đá,… kết hợp với gam màu trắng chủ đạo tạo nên vẻ đẹp sang trọng.",
            "Các loại hình căn hộ và diện tích tại dự án The Beverly - Vinhomes Ocean Park:",
            "Căn hộ The Beverly - Vinhomes Ocean Park sẽ được bàn giao hoàn thiện nội thất cao cấp theo tiêu chuẩn của Vinhomes."
        ],
        "items": [
            "Căn studio: 28 - 30,2m2",
            "Căn 1 PN: 43,2 - 48,6m2",
            "Căn 2 PN: 61,1 - 75,3m2",
            "Căn 2 PN+: 79m2",
            "Căn 3 PN: 81,5 - 85,6m2"
        ]
    },
    "Tiến Độ": {
        "paragraphs": [
            "Căn hộ chung cư The Beverly Ocean Park dự kiến sẽ được bàn giao từ quý 4/2026."
        ],
        "items": []
    }
}

{
    "Giới thiệu": "Dự án The Gloria by Silk Path là tòa căn hộ cao cấp trên đường Nguyên Hồng bên hồ Thành Công, quận Đống Đa, Hà Nội. Quy mô dự án gồm 110 căn hộ cao cấp được quản lý bởi Tập đoàn khách sạn 5 sao Silk Path Hotel & Resort. Chủ đầu tư dự án là Công ty Cổ phần In 15.",
    "Vị Trí": {
        "paragraphs": [
            "Dự án căn hộ The Gloria by Silk Path nằm tại số 8 Nguyên Hồng, phường Láng Hạ, quận Đống Đa - thuộc 4 quận nội đô lịch sử vốn khan hiếm quỹ đất dành cho các công trình cao tầng. Vị trí dự án The Gloria by Silk Path có thể coi là đắc địa hiếm thấy trong nội đô hiện tại.",
            "Dự án The Gloria by Silk Path nằm ngay giữa trung tâm ngoại giao và giáo dục của thành phố Hà Nội, giáp quận Ba Đình, khu đô thị phía Tây – trung tâm mới của thủ đô. Từ vị trí dự án The Gloria đi đến các khu vực nội thành và ngoại thành đều thuận tiện nhờ các trục giao thông mới hiện đại kết nối linh hoạt với đường vành đai 2, 3 và hệ thống đường sắt đô thị trong tương lai."
        ],
        "items": []
    },
    "Giá Bán": {
        "paragraphs": [
            "Đầu năm 2024, dự án The Gloria by Silk Path đang nhận booking để chuẩn bị mở bán.",
            "Giá bán căn hộ The Gloria by Silk Path: dự kiến khoảng 120 triệu/m2, từ 6,8 tỷ/căn 2 PN.",
            "Phí booking: 100 triệu/booking",
            "Chính sách bán hàng The Gloria by Silk Path:"
        ],
        "items": [
            "Chiết khấu 2% + gói nghỉ dưỡng cao cấp ngay khi booking",
            "Chiết khấu khác lên tới 4%",
            "Hỗ trợ ngân hàng 0% trong 12 tháng"
        ]
    },
    "Tiện Ích": {
        "paragraphs": [
            "Hệ thống tiện ích đồng bộ xung quanh dự án chung cư The Gloria by Silk Path:"
        ],
        "items": [
            "Giáo dục: Trường Đại học: Đại học Ngoại Thương, Học viện Hành Chính Quốc Gia, Học viện Ngoại giao, Đại học Giao thông vận tải, Đại học Luật, Văn hóa Hà Nội,…",
            "Các trung tâm thương mại, khu vui chơi giải trí, văn phòng: Tops Market Thăng Long, 57 Láng Hạ, PVI Tower, Sky City 88 Láng Hạ, Trung tâm chiếu phim Quốc Gia, Lotte Center,…",
            "Ngân hàng: VPbank, Maritime, Tiên Phong, Đại Á, Liên Việt…",
            "Cơ quan hành chính: Ban cơ yếu Chính Phủ, Sở lao động thương binh và xã hội, Bộ Tài Nguyên và Môi Trường…",
            "Bệnh viện: Bệnh viện Giao thông vận tải, bệnh viện Nhi, bệnh viện Phụ Sản Hà Nội…",
            "Hồ điều hòa: Hồ Thành Công, hồ Ngọc Khánh, hồ Láng"
        ]
    },
    "Thiết Kế- Mặt Bằng": {
        "paragraphs": [
            "Tọa lạc trên khu đất 2340m2, dự án The Gloria by Silk Path gồm 1 tòa tháp cao 12 tầng, 3 tầng hầm, với khoảng 110 căn hộ cao cấp và 5 căn thấp tầng. Diện tích các căn hộ The Gloria by Silk Path như sau:"
        ],
        "items": [
            "Căn 2 phòng ngủ: 56m2- 65m2 – 71m2",
            "Căn 3 phòng ngủ: 81m2"
        ]
    },
    "Tiến Độ": {
        "paragraphs": [
            "Dự án The Gloria by Silk Path hiện đang trong quá trình xây dựng, dự kiến sẽ bàn giao căn hộ vào tháng 7/2024."
        ],
        "items": []
    }
}

{
    "Giới thiệu": "Khu chung cư An Sinh là một dự án chung cư cũ tại Nam Từ Liêm, Hà Nội, được bàn giao trước năm 2010. Chủ đầu tư dự án là Công ty CP Tập đoàn Đầu tư Ba Đình.",
    "Vị Trí": {
        "paragraphs": [
            "Dự án Khu chung cư An Sinh nằm tại tổ 20, phường Cầu Diễn, quận Nam Từ Liêm, Hà Nội."
        ],
        "items": []
    },
    "Thiết Kế": {
        "paragraphs": [
            "Khu chung cư An Sinh gồm 2 tòa A, B cao 18 tầng nổi và 1 tầng hầm được sử dụng làm bãi giữ xe ô tô và xe máy. Tòa nhà chung cư An Sinh có 03 thang máy và 02 thang bộ. Tầng 18 là không gian sinh hoạt chung cho cộng đồng cư dân. Tầng 1 được cho thuê để kinh doanh dịch vụ, tiện ích như cửa hàng tiện lợi, salon tóc, cửa hàng thuốc,…",
            "Dưới đây là một số hình ảnh thực tế Khu chung cư An Sinh và bên trong căn hộ chung cư An Sinh:"
        ],
        "items": []
    }
}

{
    "Giới thiệu": "Dự án chung cư The Wisteria thuộc Khu đô thị Hinode Royal Park - sở hữu vị trí ''vàng'' lõi trung tâm huyện Hoài Đức, TP. Hà Nội, được thừa hưởng các tiện ích đẳng cấp hiện hữu trong khu đô thị rộng lớn này. Với thiết kế đẹp và diện tích đa dạng, The Wisteria mang đến nhiều lựa chọn an cư và đầu tư cho khách hàng. Dự kiến, thời gian mở bán dự án vào Quý 3/2023, bàn giao nhà vào Quý 4/2025.",
