{
    "Giới thiệu": "Chung cư The Pavilion là một trong ba phân khu thuộc The Ocean View, nằm ở cửa ngõ phía Bắc khu đô thị Vinhomes Ocean Park Gia Lâm của Tập đoàn Vingroup. Phân khu The Pavilion - Vinhomes Ocean Park gồm 4 tòa tháp với tổng cộng 2600 căn hộ, sở hữu nhiều ưu thế vượt trội và hệ sinh thái tiện ích mang phong cách “ốc đảo nghỉ dưỡng” từ Singapore. The Pavilion Vinhomes Ocean Park hứa hẹn sẽ mang đến cho chủ sở hữu căn hộ không gian “Staycation” – vừa sống, vừa nghỉ dưỡng tại chính căn hộ của mình.",
