{
    "Giới thiệu": "The Miami là một trong ba phân khu căn hộ thuộc The Metrolines Vinhomes Smart City trong khu đô thị Vinhomes Smart City của Tập đoàn Vingroup. Phân khu The Miami nằm tại giao điểm của 3 tuyến metro 5, 6, 7, ngay lối vào số 4 hướng ra đường Lê Trọng Tấn thuộc phường Tây Mỗ, quận Nam Từ Liêm, Hà Nội. Với không gian cảnh quan mang đậm phong cách nhiệt đới Mỹ, căn hộ The Miami hứa hẹn mang đến một cuộc sống xanh, năng động, chất lượng tới những công dân phía Tây thủ đô. Phân khu The Miami có tên cũ là Grand Sapphire, được coi là một trong những “viên ngọc” đắt giá của dòng sản phẩm Vinhomes Sapphire, hội tụ tinh hoa từ những khu đô thị sầm uất trên thế giới, tiêu biểu là thành phố Miami của Mỹ. Phân khu này có tổng diện tích khoảng 3,3ha, bao gồm 5 tòa căn hộ cao 38 tầng với tên gọi GS1, GS2, GS3,GS5 và GS6. Trong đó, GS2 sẽ là tòa căn hộ được mở bán đầu tiên. Chủ đầu tư của dự án phân khu Miami - Vinhomes Smart City là Công ty Cổ phần Đầu tư Xây dựng Thái Sơn - một công ty con của Vinhomes. Thái Sơn được thành lập vào ngày 22/07/2007, có trụ sở chính tại số 7, đường Bằng Lăng 1, khu đô thị sinh thái Vinhomes Riverside, phường Việt Hưng, quận Long Biên, Hà Nội. Doanh nghiệp hoạt động trong lĩnh vực đầu tư, xây dựng và kinh doanh bất động sản. Ngày 08/05/2018, Công ty Thái Sơn được Vinhomes mua lại 96,5% cổ phần với giá trị 1.700 tỷ đồng. Đơn vị quản lý và vận hành dự án The Miami là Công ty Cổ phần Vinhomes.",
