    "Giới thiệu": "Tổ hợp căn hộ dịch vụ thương mại Núi Trúc Square là một sản phẩm của Hợp tác xã Thương mại và Dịch vụ Hợp Thành tại trung tâm quận Ba Đình, Hà Nội. Đây là một trong số ít những dự án căn hộ sở hữu vị trí đắc địa nằm trong khu trung tâm của Thủ đô nên không chỉ hứa hẹn là nơi an cư lý tưởng mà còn là cơ hội sinh lời lý tưởng cho các nhà đầu tư nhạy bén. Được trang bị đầy đủ các dịch vụ tiện ích sang trọng, Núi Trúc Square tạo ra một phong cách sống đẳng cấp với một không gian văn hóa khác biệt với lối kiến trúc hiện đại phối kết hợp hài hòa cùng không gian xanh mát nơi phố thị tấp nập. - Tên dự án: Chung cư Núi Trúc Square Giảng Võ - Vị trí: Số 17 ngõ Núi Trúc, quận Ba Đình, Hà Nội - Chủ đầu tư: Hợp tác xã Thương mại và Dịch vụ Hợp Thành - Tư vấn giám sát: Công ty CP Tư vấn Đô thị Việt Nam Vinacity - Đơn vị thiết kế: Công ty CP Tư vấn Thiết kế D+D Việt Nam - Đơn vị phân phối: Công ty CP Địa ốc Nhà Vuông - Diện tích đất quy hoạch: 1052m2 + Tầng hầm: Khu vực đậu xe + Từ tầng 1-8: Khu căn hộ + Từ tầng 9-10: Căn hộ penthouse - Tổng diện tích sàn xây dựng: 9.120m2 - Mật độ xây dựng: 70% - Hệ số sử dụng đất: 10,76 lần - Quy mô: 10 tầng nổi, 1 tầng hầm - Số căn hộ: 69 căn Vị trí Chung cư Núi Trúc Square tọa lạc tại số 17, Ngõ Núi Trúc, quận Ba Đình, Hà Nội. Vị trí này nằm rất gần với các tuyến phố quan trọng của thành phố như Kim Mã, Giảng Võ, Nguyễn Thái Học, Láng Hạ... nên việc di chuyển, kết nối đến các địa điểm, khu vực khác là vô cùng dễ dàng và nhanh chóng. Khu vực quanh dự án cũng được đồng bộ cơ sở hạ tầng hiện đại và là một trong những khu vực sầm uất bậc nhất Thủ đô nên trong vòng bán kính vài km từ dự án, cư dân có thể tìm thấy những tiện ích cần thiết cho cuộc sống hiện đại của mình gồm các trung tâm hành chính, chính trị, đại sứ quán, ga tàu điện ngầm sẽ hình thành trong tương lai, khu di tích Chủ tịnh Hồ Chí Minh, Văn miếu Quốc Tử Giám, Khách sạn Deawoo, Lotte Center… Giới hạn vị trí dự án: - Phía Bắc tiếp giáp đường quy hoạch rộng 22m - Phía Nam giáp mặt đường ngõ Núi Trúc - Phía Đông tiếp giáp với khu dân cư hiện hữu - Phía Tây tiếp giáp với trường Cao đẳng nhạc Vũ kịch Việt Nam, trung tâm tiếng Nhật, hồ Giảng Võ",
