{
    "Giới thiệu": "The Ninety Complex là dự án căn hộ khách sạn tiên phong mô hình căn hộ WELLNESS-SMART (kết hợp chăm sóc thân-tâm-trí và ứng dụng công nghệ smarthome thiết lập bối cảnh từ Schindler Pháp). Dự án tạo lạc tại 90 đường Láng, phường Ngã Tư Sở, quận Đống Đa, Hà Nội. Đây là nơi có quần thể cư dân văn minh đã hình thành và phát triển sầm uất, với cơ sở hạ tầng, tiện ích ngoại khu vô cùng hiện đại và đa dạng, đầy đủ. Với vị trí trung tâm của trung tâm, chủ nhân tại dự án The Ninety Complex sẽ kiếm lợi nhuận ổn định từ việc cho thuê nhà với mức giá cao và nguồn khách dồi dào, vị trí đẹp, sản phẩm khan hiếm cùng mức giá hấp dẫn là bảo chứng cho tiềm năng sinh lời chắc chắn, ổn định và dài lâu. • Tên thương mại: The Ninety Complex • Vị trí dự án: số 90 Đường Láng, phường Ngã Tư Sở, quận Đống Đa, Hà Nội • Chủ đầu tư: Công ty TNHH Điện tử Ánh Sao • Đơn vị phát triển dự án: Rox Living • Diện tích khu đất: 3.361m2 • Mật độ xây dựng: 45% • Quy mô dự án: 27 tầng nổi và 4 tầng hầm • Tầng 1: Sảnh đón tiếp và dịch vụ thương mại • Tầng 2: Dịch vụ thương mại, nhà hàng ẩm thực • Tầng 3: Thư viện số, phòng vui chơi giải trí, phòng yoga, phòng tập thể thao và bể bơi 4 mùa • Tầng 4 – 27: Căn hộ khách sạn, diện tích thông thủy từ 31,3 – 92,1 m2 • Tổng thầu: DELTA • Quản lý vận hành tòa nhà: CBRE Viet Nam • Tiêu chuẩn bản giao: Full nội thất cao cấp liền tường nhập khẩu tích hợp smarthome, full thiết bị bếp có hút mùi, full thiết bị vệ sinh có nóng lạnh, full điều hòa âm trần Multi.. • Pháp lý: Căn hộ du lịch 50 năm tới Quý III/2068 (công trình cấp 1 nhóm A, niên hạn sử dụng trên 100 năm, sau 2068 CĐT hỗ trợ thủ tục gia hạn sử dụng căn hộ theo niên hạn công trình) • Dự kiến bàn giao : Quý I/2025",
