{
    "Giới thiệu": "Tháp Vạn Phúc 36T là dự án căn hộ biệt thự vườn tưới tiêu tự động trên cao đầu tiên tại Hà Nội. Dự án nằm tại ngã tư đường Tố Hữu và đường Vạn Phúc, Hà Đông, đối diện làng nghề Vạn Phúc, gồm 1 tòa nhà có 3 tầng hầm và 36 tầng nổi. Các tầng và trên mái được bố trí những khoảng cây xanh để tạo nên một không gian sống trong lành, tươi mát, gần với thiên nhiên. Mỗi căn hộ cũng đều được thiết kế điểm nhìn tốt, có khe logia để các phòng đều có thể tiếp xúc với thiên nhiên, đón gió và ánh sáng bên ngoài. Căn hộ có diện tích trên 120m2 còn có một khu vườn nhỏ, thác nước hoặc hòn non bộ, thư viện hay phòng đa năng để giúp che nắng. - Tên dự án: Tháp Vạn Phúc 36T - Chủ đầu tư: Công ty TNHH Đầu tư xây dựng và Thương mại An Thái - Vị trí: Ngã tư đường Tố Hữu (Lê Văn Lương kéo dài) và đường Vạn Phúc, phường Vạn Phúc, quận Hà Đông, TP. Hà Nội - Diện tích xây dựng: 86.000m2 - Quy mô: 1 tòa chung cư cao 36 tầng nổi và 3 tầng hầm - Vốn đầu tư: 910 tỷ đồng - Hình thức sở hữu: Lâu dài Phối cảnh dự án Tháp Vạn Phúc 36T",
