{
    "Giới thiệu": "Chung cư Golden West được biết tới là một dự án trọng tâm khu quy hoạch kinh tế, cơ sở hạ tầng mới của quận Thanh Xuân, Hà Nội. Dự án tọa lạc tại đường Lê Văn Thiêm, thuộc Khu đô thị mới trung Hòa Nhân Chính.",
