    "Giới thiệu": "Dự án Tân Việt Tower nằm trong khu nhà ở Đức Thượng, xã Đức Thượng, huyện Hoài Đức, TP. Hà Nội, đối diện Khu đô thị Tân Tây Đô, cạnh mặt đường Quốc lộ 32 với quy mô dự án gần 6 ha, được thiết kế với 2 toà tháp chung cư, 3 khối biệt thự, 3 khối liền kề và đất nền. Tổng diện tích sàn xây dựng là 37.500m2 gồm 2 toà chung cư A và B cao 30 tầng và 1 tầng hầm, xen giữa 2 khối cao tầng là khối thấp tầng có quy mô là 5 tầng nổi thương mại và 1 tầng hầm. Với trục đường 32 được mở rộng hoàn thiện, quý khách chỉ mất 10 phút đi xe từ dự án tới trung tâm quận Cầu Giấy. Ngoài các tầng thương mại, từ tầng 6 đến tầng 30 là các căn hộ riêng biệt có diện tích từ 78m2-82m2-87m2-90m2-115m2. Mỗi sàn có 10 căn hộ. Tùy theo diện tích, mỗi căn hộ được thiết kế 2 hoặc 3 phòng ngủ. Ngoài ra, Tân Việt Tower còn có khuôn viên cây xanh, khu vui chơi giải trí và một số tiện ích khác. Khu liền kề và biệt thự mang lại sự đồng bộ và cung cấp thêm không gian cho toà nhà. Đặc biệt, dự án nằm trong tổng thể phát triển quy hoạt của các dự án phía Tây Bắc Hà Nội bao gồm các khu đô thị hiện đại như Lideco, Kim Chung di Trạch, Tân Tây Đô và hệ thống các trường học từ mẫu giáo đến Đại học. Hệ thống chợ truyền thống và các dịch vụ thương mại sầm uất đã mang đến cho dự án tiện ích đầy đủ, hiện đại.",
