    "Thông tin Tòa nhà Licogi 18": {
        "paragraphs": [
            "Tòa nhà Licogi 18là một trong hai hạng mục của Dự án Trung tâm thương mại và phát triển nhà Mê Linh do Công ty CP Đầu tư và Xây dựng Số 18 (LICOGI-18) làm chủ đầu tư. Tổng mức đầu tư của dự án là 63 tỷ đồng, được triển khai từ năm 2004, địa điểm xã Quang Minh - huyện Mê Linh - tỉnh Vĩnh Phúc.Nắm bắt nhu cầu về đất ở một bộ phận lớn người dân sống lân cận Khu công nghiệp Quang Minh, siêu thị nội thất Mê Linh PLAZA, Công ty sữa Hà Nội,... Công ty LICOGI-18 quyết định đầu tư thực hiện dự án Trung tâm thương mại và phát triển nhà Mê Linh theo quyêt định số 2367/QĐ-UB ngày 24/06/2003 của UBND tỉnh Vĩnh Phúc với quy mô diện tích đất 7.400m2 và tổng mức đầu tư ước tính hơn 63 tỷ đồng. Dự án bao gồm một chung cư 12 tầng để bán và một Trung tâm thương mại 3 tầng để kinh doanh các dịch vụ phục vụ sinh hoạt của người dân nhà chung cư.Hạng mục nhà chung cư 12 tầng do chính Công ty LICOGI-18 xây dựng đạt tiêu chuẩn chất lượng cao, kiến trúc hiện đại, có vị trí thuận lợi (cách trung tâm TP. Hà Nội 15km và cách sân bay quốc tế Nội Bài 4km) bao gồm 132 căn hộ, hệ thống hàng rào sân vườn, điện nước tiện nghi và các đầy đủ các dịch vụ thiết yếu phục vụ tốt cho nhu cầu sinh hoạt của những người dân sống trong nhà chung cư. Công trình được xây dựng hoàn thành và đưa vào khai thác sử dụng từ tháng 6/2007 đã thu hút được sự chú ý của những người dân có nhu cầu nhà ở trong khi mức thu nhập không cao và đặc biệt phù hợp với 4 loại căn hộ theo diện tích 85m2, 100m2, 110m2, 120m2.",
