            "Hạ tầngTổ hợp công trình bao gồm 4 tòa tháp (28 tầng) chia thành 2 khối:- Tầng hầm & phần đế:+ Tầng hầm: Được thiết kế 2 tầng, tầng hầm 1 có chiều cao hơn 5m. Tổng diện tích 2 tầng hầm là 17.000m2+ Phần đế: Được bố trí từ tầng 1-3, thiết kế riêng biệt cho các khu dịch vụ giải trí, chăm sóc sức khoẻ, có không gian tiếp cận trực tiếp với các khu vực chung quanhĐây cũng là nơi bố trí các khu dịch vụ dành riêng của tòa nhà như nhà trẻ, câu lạc bộ dành cho khách VIP, CLB thể dục thẩm mỹ, trung tâm chăm sóc sắc đẹp, hồi phục sức khỏe, bể bơi và khu phụ trợ…Đặc biệt, các tầng cây xanh được bố trí phù hợp trên tất cả các tầng, tạo nên những khoảng không gian xanh cho công trình.- Khối tháp cao từ tầng 4 đến tầng 28, trong đó:+ Khối  A (tháp 1, tháp 2): Tiếp giáp với đường Nguyễn Phong Sắc kéo dài- Khối  B (tháp 3, tháp 4): Tiếp giáp với đường Trần BìnhTừ tầng 5 ÷ tầng 28 là các căn hộ tiện nghi, hiện đại, được thiết kế thích nghi với đặc thù khí hậu nhiệt đới với những khoảng không gian xanh nhằm tạo nên cuộc sống thoải mái cho cư dân, đảm bảo cho cả nhu cầu riêng tư và hòa nhập cộng đồng.",
            "Với thiết kế tách rời các khối nhà, toà nhà có tầm nhìn rộng. Đó là hướng nhìn từ Dolphin, từ từng căn hộ, khu văn phòng, khu vui chơi ra thiên nhiên, tới khu vực công viên cây xanh 22 ha (chuẩn bị được Thành phố xây dựng), là các toà nhà cao đẹp lân cận (Manor, Keangnam...) Đó cũng là cánh cửa đón nắng, đón gió, đón những vòng quay chuyển động của thiên nhiên tới từng căn hộ.",
            "Điểm nhấn của Tổ hợp công trình là mảng kiến trúc sinh thái, kiến trúc xanh - Sky Garden khiến công trình nổi bật với sắc xanh tươi mát tại khu vực cửa ngõ phía Tây thủ đô, với:- Hơn 6.000m2 sân vườn, cây xanh mặt đất- 1 bể bơi trải dài cùng với bể massage như tấm gương phản chiếu ánh sáng thiên nhiên cho cả khu Sky Garden- Các khu vui chơi trẻ em với đường dạo lát gỗ, ghế nghỉ, khu nhà hàng được bố trí khéo léo giữa những sân vườn, dưới những cây tán lá rộng trên tầm cao trên 17m so với mặt đường giao thông khiến không gian xanh và sạch của toà nhà như tách biệt với cuộc sống ồn ào của khu vực đang phát triển năng động nhất Hà Nội.- Hệ thống tầng cây xanh ở cốt +17.5m kết nối các khối tháp thành một thể thống nhất, liên hoàn đồng thời tạo một khu vườn treo trên cao rất độc đáo- Vườn cây nối liền với sảnh thang máy- Và ánh sáng tràn vào tất cả các góc trong mỗi căn hộ, từ phòng ngủ đến phòng bếp- Đưa thiên nhiên hoà quyện với cuộc sống hiện đại, tạo môi trường sống xanh và sạch trên những tầng cao không chỉ là dấu ấn của các kiến trúc sư nổi tiếng Singapore mà chính là tâm huyết của các nhà đầu tư dành cho những cư dân tương lai của Dolphin Plaza",
            "Trang bị tại các hộ gia đình: Hệ thống Home Automation thông minh nhằm tăng cường sự tiện ích trong sinh hoạt hằng ngày và đảm bảo an ninh như:- Báo trộm, báo cháy- Tự động khoá/ngắt gas- Điều khiển tự động hệ thống chiếu sáng, rèm cửa, điều hoà,....- Tích hợp hệ thống bảo vệ an ninh, xác nhận khách đến thăm, lập danh sách các khách đến thăm- Hệ thống màn hình cảm ứng để theo dõi: nhiệt độ phòng, bật tắt các thiết bị báo động, báo bảo vệ,..- Hệ thống khoá cửa an toàn sử dụng mật khẩu- Tivi phone trong phòng tắm và phòng bếp- Đội ngũ Bảo vệ chuyên nghiệp ngay từ cổng với camera, thẻ từ theo dõi khách ra vào- Thẻ VIP thang máy- Quy trình kiểm soát an ninh, phòng cháy chữa cháy, điều khiển ánh sáng,... được áp dụng theo tiêu chuẩn quốc tế.",
            "Các căn hộ của Dolphin Plaza có những ưu việt nổi bật sau:- Diện tích các phòng chức năng (như phòng khách, phòng bếp, phòng ngủ,..) rộng, thoáng. Trong đó, phòng khách có chiều rộng tới ~5 m, đặc biệt có phòng rộng đến 5.6m- Phòng ngủ: Ngoài các phòng ngủ trung bình, mỗi căn hộ đều có phòng ngủ lớn (master bed room – từ 22 -> 30 m2) với phòng tắm đôi và hệ thống rèm được điều khiển tự động từ xa,..- Hành lang của mỗi căn hộ là không gian riêng của các gia đình, có diện tích rộng, thoáng, có ánh sáng tự nhiên, độc lập với các căn hộ kế bên và đặc biệt an toàn với các sinh hoạt gia đình, nhất là trẻ em.- Phòng bếp luôn có ánh sáng tự nhiên và thoáng khí, hạn chế tối đa việc bị hấp mùi thức ăn,..- Mỗi phòng trong căn hộ đều có ban công riêng. Phòng khách có ban công rộng 2m, phòng ngủ có ban công rộng 1m.Mặt bằngVới tư tưởng thiết kế “nhà trong vườn - vườn trong nhà”, phong cách Dolphin Plaza kéo thiên nhiên vào tầm với của bạn một cách ngẫu hứng nhưng thống nhất về ý tuởng, chỉn chu nhưng thoả mãn những đam mê.",
            "4 toà nhà xoè rộng đặc sắc, gọi ánh sáng vào từng góc phòng trong mỗi căn hộ. Từ tầm nhìn không giới hạn mở ra thiên nhiên, cư dân Dolphin Plaza được tận hưởng phong cách mới của cuộc sống Hà Nội. Cũng từ tầm nhìn trải rộng, toàn cảnh trung tâm hành chính mới của Hà Nội được thu về căn hộ tại Dolphin Plaza."
        ],
