{
    "Giới thiệu": "Dự án Park View City (Yên Hòa Park View) tọa lạc ở vị trí vô cùng đắc địa, tại lô E4 Khu đô thị mới Yên Hòa, quận Cầu Giấy, TP. Hà Nội, ngay sát ngã tư Trung Kính và Vũ Phạm Hàm, đây là một trong những vị trí trung tâm của khu đô thị này. Tổ hợp chung cư được xem như là một điểm sáng nổi bật trong khu đô thị Yên Hòa, giữa một bên là khu đô thị hiện đại đang phát triển mạnh bên ngoài và dự án đô thị mới trung tâm thành phố. Dự án bao gồm nhà ở cao tầng, nhà vườn, khu nhà ở công vụ và những tiện ích có sẵn như công viên, hồ điều hòa, trường mầm non, trường học các cấp... Trong đó có tổ hợp nhà ở cao tầng gồm các khu E3A, E3B, G3C, G3D, G3AB... Chung cư E4 Yên Hòa có diện tích giao thông, kỹ thuật chiếm 20% sàn xây dựng một tầng căn hộ. Bố cục này được đảm bảo tất cả các hộ đều được tếp xúc tối đa với ánh sáng tự nhiên. Phần lõi giao thông cũng đảm bảo được thông thoáng tự nhiên nhờ lấy sáng của 1 bên hành lang, thang thoát hiểm được bố trí tiếp xúc với bên ngoài, đảm bảo ánh sáng và thông thoáng. Công văn mới nhất số 2447/QHKT- P1 ban hành ngày 26/08/2010 của Sở Quy hoạch Kiến trúc Hà Nội đã hoàn toàn đồng ý để quy hoạch tổng mặt bằng và các vẫn đề về kiến trúc nhà ở cao tầng - dịch vụ ở lô đất mang tên chung cư E4 Khu đô thị mới Yên Hòa. Dự án gồm 3 khối nhà cao tầng và 2 tầng tầng hầm chung. - Tên chính thức: Tổ hợp trung tâm thương mại, Văn phòng và Căn hộ cao cấp E4 Yên Hòa - Chủ đầu tư: Công ty CP Xây dựng Dân Dụng Hà Nội (HCCI, doanh nghiệp là công ty thành viên của Tổng Công ty Đầu tư Phát triển Hạ tầng Đô Thị (UDIC) - Đơn vị thiết kế: Công ty CP VTIC Việt Nam - Đơn vị tư vấn giám sát: Công ty TNHH MTV Việt Green - Đơn vị xây dựng: Xí nghiệp Xây lắp Số 1, Công ty CP Xây dựng Dân dụng Hà Nội - Tổng diện tích: 9.065m2 - Mật dộ xây dựng: 32% - Thiết kế: Tòa CT1 cao 25 tầng, tòa CT2 và CT3 cao 19 tầng, giữa 03 tòa nhà có 02 tầng hầm thông nhau - Hình thức sở hữu: Vĩnh viễn - Diện tích phong phú: Từ 1-3 phòng ngủ",
