{
    "Giới thiệu": "Chung cư 622 Minh Khai là dự án đầu tư xây dựng nhà ở xã hội, dự kiến triển khai từ quý IV/2017-IV/2018. Với vị trí đắc địa, thuận tiện lưu thông, nhà ở xã hội 622 Minh Khai hứa hẹn sẽ là dự án được nhiều khách hàng quan tâm. - Tên của chính thức: Nhà ở xã hội chung cư 622 Minh Khai - Chủ đầu tư: Handico 5 - Quy mô: 11.910m2, trong đó khu nhà ở chung cư cao tầng có diện tích xây dựng là 5.220m2, cụ thể: + Diện tích xây dựng tòa CT1A và CT1B là 2.880m2 + Diện tích xây dựng tòa CT1C là 2.340m2 + Mật độ xây dựng là 43.8% + Phần còn lại là khuôn viên cây xanh, vỉa hè, sân chơi... Phối cảnh chung cư 622 Minh Khai",
    "Hạ tầng - Quy hoạch": {
        "paragraphs": [
            "Tiện ích nội khu",
