{
    "Giới thiệu": "Ecohome 2 là dự án nhà ở xã hội được xây dựng với tiêu chí \"Nhà ở xã hội - Chất lượng thương mại\". Chủ đầu tư dự án là Công ty CP Đầu tư & Thương mại Thủ Đô (Thủ Đô JSC). Chung cư được phát triển với mục tiêu thúc đẩy kinh tế khu đô thị phía Bắc Hà Nội, giúp cho hàng trăm nghìn hộ dân thu nhập thấp tìm được chốn an cư, ổn định lâu dài, từng bước cải thiện cuộc sống và phát triển an sinh xã hội. Dự án tọa lạc giữa một quần thể không gian xanh gần sông Hồng, tiếp giáp với tuyến đường Tân Xuân, không phải là các căn hộ bê tông cốt thép chật chội mà được thiết kế hài hòa, tinh tế cùng không gian mở. Chung cư nhà ở xã hội được triển khai xây dựng trên quy mô 15.778m2, diện tích sàn xây dựng hơn 93.000m2 với tổng cộng 980 căn hộ với các loại diện tích đa dạng từ 36,56m2; 63,3m2; 68,5m2; 69,6m2; 69,8m2. Dự án được thiết kế với ý tưởng tạo ra không gian sống hiện đại và tiện nghi, dùng năng lượng mặt trời, cây xanh, vật liệu xây dựng gần gũi với thiên nhiên. Ecohome 2 tạo nên cảm giác thoải mái cho cư dân, không gian kiến trúc kết hợp hài hòa với môi trường xung quanh. Trong lòng dự án là khu vườn đi dạo với bể bơi lớn, cây xanh tạo môi trường sống tươi mát, trong lành cho cư dân.",
