{
    "Giới thiệu": "Megastar Dominium C2 Xuân Đỉnh được định vị tại lô C2, Xuân Đỉnh, Từ Liêm, Hà Nội, một địa điểm đắc địa gần kề Khu dự án Ngoại Giao Đoàn, gần cảnh quan thiên nhiên đẹp nhất Hà Nội là Hồ Tây. Dự án có tổng diện tích 2.578m2, xây dựng 1.400m2 (34.160m2 sàn, chưa tính tầng hầm và tầng kỹ thuật). Cảnh quan thiên nhiên sinh động của công viên và hồ điều hòa Xuân Đỉnh, sân chơi của trẻ ngay chân công trình. Tòa nhà cao 25 tầng (chưa bao gồm tầng hầm và tầng kỹ thuật) được thiết kế theo kiến trúc đối xứng với biểu tượng cánh chim bay trên không gian cảnh quan của Hồ Tây. Hai tầng hầm với sức chứa 100 ô tô và 800 xe máy (bãi đậu xe ngoài trời dành cho khách), 336 căn hộ sang trọng với 3 loại căn hộ được thiết kế đa dạng, tầm nhìn trải rộng cảnh quan thiên nhiên Hồ Tây và sự phát triển của Hà Nội.",
