{
    "Giới thiệu": "Chung cư Nàng Hương - 583 Nguyễn Trãi là tòa nhà ở và dịch vụ thương mại Nàng Hương được xây trên mặt đường Nguyễn Trãi do Công ty Tư vấn Đại học Xây dựng - Bộ Xây dựng thiết kế và đã được Công ty CP Tư vấn Thiết kế Kiến trúc và Đầu tư Xây dựng Việt Nam (AIC) thẩm tra ngày 21/11/2007. - Tên dự án: Chung cư Nàng Hương - 583 Nguyễn Trãi - Chủ đầu tư: Công ty CP Xây lắp điện I - Diện tích khu đất: 9507m2, trong đó diện tích xây dựng nhà ở là 5211m2 - Quy mô: gồm 2 tòa: + Tòa nhà cao tầng CT1 (17 tầng), trong đó 1 tầng hầm, 2 tầng dịch vụ và thương mại, 15 tầng căn hộ có diện tích từ 72m2 - 98m2 - 109m2 - 117m2 + Tòa nhà cao tầng CT2 (21 tầng), trong đó 2 tầng hầm, 2 tầng dịch vụ và thương mại, 19 tầng căn hộ có diện tích các căn từ 72m2 - 98m2 - 109m2 - 117m2. Chung cư Nàng Hương - 583 Nguyễn Trãi được xây dựng với đầy đủ các tiện ích như nhà sinh hoạt công cộng, nhà trẻ, vườn hoa và sân thể thao diện tích 620m2. Hệ thống chiếu sáng được lắp đặt đồng bộ phù hợp chiếu sáng cho các công trình. Với những ưu thế có sẵn, tòa nhà ở và dịch vụ thương mại Nàng Hương sẽ là sự lựa chọn lý tưởng cho mọi đối tượng khách hàng có nhu cầu muốn mua các căn hộ chung cư và biệt thự.",
