{
    "Giới thiệu": "Park Kiara là dự án căn hộ nằm trong quần thể khu đô thị Park City Hà Nội tại quận Hà Đông do CTCP Phát triển Đô thị Quốc tế Việt Nam làm chủ đầu tư. Được phát triển trong tổng thể khu đô thị hiện đại sự kết hợp giữa phong cách đô thị năng động cùng không gian sống xanh, Park Kiara sẽ mang đến trải nghiệm sống đẳng cấp, xứng tầm là nơi an cư hoàn hảo cho cộng đồng cư dân thịnh vượng. Park Kiara gồm 2 block cao 31 tầng, trong đó mỗi block sẽ gồm 1 tầng hầm, 4 tầng podium cùng 27 tầng cao với 432 căn hộ sở hữu thiết kế tinh tế, được chú trọng đến từng chi tiết nhỏ và đều có tầm nhìn đẹp ôm trọn những không gian ấn tượng nhất của KĐT ParkCity Hanoi. Với vị trí đắc địa tại khu vực hạ tầng phát triển, xung quanh là các khu đô thị năng động, gần kề 2 tuyến đường Lê Trọng Tấn, Tố Hữu -  Park Kiara cũng được sở hữu kết nối thuận tiện đến các khu vực, tiện ích hiện hữu, hứa hẹn sẽ là một địa chỉ an cư, nghỉ dưỡng và đầu tư sinh lợi hoàn hảo.",
